export default function cleanSet(set, startString) {
	let str = '';
	str += set.map(elem => {
		let string = '';
		if (elem.startsWith(startString)) {

			if (elem.length > startString.length) {
				if (str !== '') {
					string += '-';
				}
				for (let i = startString.length ; i < elem.length ; i += 1) {
					string += elem[i];
				}
			}
		}
		return string;
	})
	return str;
}

